import React from "react";
import { useDispatch, useSelector } from "react-redux";
import{getPokemon}from '../Store/action'
import './nav.css';
import { Link } from "react-router-dom";

 const NavBar = () => {
  const dispatch =useDispatch()
 
  return (
    <nav className="caja-de-navbar">
            <ul className="botones"><Link onClick={()=>dispatch(getPokemon())} to="/"><h2>Pokemones</h2></Link></ul>
            <ul className="botones"><Link  to="/create"><h2>Create</h2></Link></ul>
            <ul className="botones"><Link  to="/create"><h2>Create</h2></Link></ul>
            <ul className="botones"><Link  to="/team"><h2>My team</h2></Link></ul>
            <ul className="botones"><Link  to="/team"><h2>About</h2></Link></ul>
      
    </nav>
  );
};
export default NavBar;
